<p class="Section transitional&#xA;        "><strong><a id="s-233."><span class="sectionLabel">233.</span></a></strong> La partie XIX.1 de la <cite class="XRefExternalAct"><a href="/fra/lois/C-44">Loi canadienne sur les sociétés par actions</a></cite>, édictée par l’article 115 de la présente loi, ne s’applique pas aux procédures engagées avant l’entrée en vigueur de cet article.</p>
